import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Check if cart is empty - if so, add an item first
    const cartText = await page.textContent('.cart');
    if (cartText.includes('0')) {
      // Add item to cart by clicking first product card
      await page.waitForSelector('.product-card', { timeout: 5000 });
      await page.click('.product-card');

      // Wait for product modal and add to cart
      await page.waitForSelector('.modal-content', { timeout: 5000 });
      await page.click('.add-to-cart');
      await page.waitForTimeout(1000); // Brief wait for cart update
    }

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('.cart-modal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_open.png'));

    // Remove item from cart
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    await page.click('.remove-item');
    await page.waitForTimeout(1000); // Wait for removal animation

    // Verify removal by checking cart count
    const updatedCartText = await page.textContent('.cart');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_updated.png'));

    return {
      success: true,
      action: "Successfully removed item from cart",
      extractedData: {
        initialCartCount: cartText.trim(),
        updatedCartCount: updatedCartText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
